import { Button } from 'antd'
import React from 'react'

export const PartIssue = () => {
  return (
    <>
    <h2 style={{textAlign:"center"}}>Update Parts</h2>
    <div style={{margin:"auto", border:"1px solid red",width:"400px",height:"300px"}}>
    <Button style={{width:"50%",height:"50px",position:"relative",top:"120px"}}>Add Part</Button>
    </div>
    </>
  )
}
